import React from 'react'


function Header() {
    return (
        <div className="header">
            <div className="header__logo"></div>
            <div className="header__searchbar"></div> 
            <div className="header__upload--btn"></div>
            <div className="header__user--img"></div>
        </div>
    )
}

export default Header
